import React, { Fragment, useEffect, useState } from "react";




//View Summary function

const ViewSummary = () => {

    const [pending_summary, SetPending_Summary] = useState([]);

    const getpending_summary = async () => {
        try {
            const response = await fetch("http://localhost:5000/api/Summary");
            const jsonData = await response.json();
            
            SetPending_Summary(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    }

    useEffect(() => {
        getpending_summary();
    } , []);


    //get support team summary data
    const [team_summary, SetTeam_Summary] = useState([]);

    const getSupportTeamSummary = async () => {
        try {
            const response = await fetch("http://localhost:5000/api/summary/:support_team_required");
            const jsonData = await response.json();
            
            SetTeam_Summary(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    }

    useEffect(() => {
        getSupportTeamSummary();
    } , []);



//get capacity info by date
    const [capacity, setCapacity] = useState([]);
  
    const getCapacity = async (day) => {
        try {
            const response = await fetch(`http://localhost:5000/api/capacity/${day}`);
            const jsonData = await response.json();
            
            setCapacity(jsonData);
        } catch (err) {
            console.error(err.message);
        }
    }
    useEffect(() => {
        getCapacity();
    } , []);

    return (
        <Fragment>
            <div style={{ backgroundColor: '#BED3AB', padding: '40px', borderRadius: '30px', margin: '60px' }}>
                <table class="table table-hover table-responsive-md table align-middle table caption-top">
                <caption><h2>Pending Requests</h2></caption>
            <thead>
                <tr>
                    <th>Count</th>
                    <th>Priority</th>
                    <th>Support Team Required</th>
                </tr>
            </thead>
            <tbody>
                {pending_summary.map((item) => (
                    <tr>
                        <td>{item.pending}</td>
                        <td>{item.priority}</td>
                        <td>{item.support_team_required}</td>
                    </tr>
                ))}
            </tbody>
            </table>
            <br />
            <table class="table table-hover table-responsive-md table align-middle table caption-top">
                <caption><h2>Total Requests Raised</h2></caption>
            <thead>
                <tr>
                    <th>Count</th>
                    <th>Support Team Required</th>
                </tr>
            </thead>
            <tbody>
                {team_summary.map((item) => (
                    <tr>
                        <td>{item.count}</td>
                        <td>{item.support_team_required}</td>
                    </tr>
                ))}
            </tbody>
            </table>

            <br />
            <p>Select the date you would like to view capacity for</p>
            <input type="date" onChange={(e) => getCapacity(e.target.value)} />
            <table class="table table-hover table-responsive-md table align-middle table caption-top">
                <caption><h2>Capacity</h2></caption>
                
            <thead>
                <tr>
                    <th>Team</th>
                    <th>Date</th>
                    <th>Total Capacity</th>
                    <th>Available Capacity</th>
                    <th>Booked Capacity</th>
                </tr>
            </thead>
            <tbody>
                {capacity.map((item) => (
                    <tr>
                        <td>{item.team}</td>
                        <td>{new Date(item.day).toLocaleDateString('en-GB')}</td>
                        <td>{item.total_capacity}</td>
                        <td>{item.available_capacity}</td>
                        <td>{item.booked_capacity}</td>
                    </tr>
                ))}
            </tbody>
            </table>
            </div>
           
        </Fragment>
    )
};

export default ViewSummary;
